  input: '"TEXT","SB23","D534","October 10, 2002 John D. Gibson Assistant Staff Director
    Reports Analysis Division 999 E Street, NW Washington, DC 20463 RE: May Monthly
    (4/1/01-4/30/01) and June Monthly (5/01/01-5/31/01) Reports Dear Mr. Gibson: Please
    allow me to apologize for not promptly responding to Ms. Jane Parks'' two letters
    dated August 21, 2002, regarding the above referenced Federal Election Commission
    (FEC) reports.  I have been out of the office on personal medical leave since
    July 25, 2002, due to hip replacement surgery and serious resulting complications,
    which have forced me to remain out of the office.  To make the timing even worse,
    as a result of staff departures in the last several months (including Lisa Blackwell,
    to whom Ms. Parks addressed her letters), I have been the only staff person handling
    these matters.  Consequently, these two letters did not come to my attention until
    after my office received your letter dated September 12, 2002, and alerted me.  I
    greatly appreciate your consideration of these extenuating circumstances.  Please
    be advised that I am making arrangements to appoint an Assistant Treasurer of
    ARCHIPAC to avoid any similar clerical oversights in the future.  With respect
    to Ms. Parks'' letter regarding the June 2001 monthly report, ARCHIPAC''s payment
    of in-house catering costs to its connected organization (The American Institute
    of Architects (AIA)) was not for expenditures intended by AIA to influence any
    federal elections.  Rather, ARCHIPAC paid AIA for these in-house catering costs,
    and reported these costs as an in-kind contribution to Rep. Kay Granger, albeit
    incorrectly.  To clarify that this was an in-kind contribution by ARCHIPAC to
    Rep. Granger and to correct the exact date, on which ARCHIPAC paid AIA for the
    catering costs, I am attaching an amended June 2001 monthly report.  Because ARCHIPAC
    does not customarily use AIA''s in-house catering for fundraising events, we did
    not realize until after reviewing Ms. Park''s letter and consulting with outside
    counsel that such costs should have been paid in advance of the fundraising event
    by ARCHIPAC to AIA.  For your information, we have also reviewed our records and
    found no other fundraising events since May 2001 for which in-house catering costs
    were paid by AIA before or afterwards.  We very much appreciate your bringing
    this to our attention.  Should AIA ever provide in-house catering for another
    ARCHIPAC fundraising event, we will be sure to pay AIA in advance for such costs.  With
    respect to Ms. Parks'' letter regarding the May 2001 monthly report, I am attaching
    an amended report listing in Schedule A all of the original contributors disclosed
    on Schedule B.  Due to a clerical oversight, several but not all of those individuals
    who earmarked contributions during May 2001 were listed on both schedules.  I
    hope that this letter and the attached amended May and June 2001 monthly reports
    fully satisfy the reporting discrepancies pointed out by Ms. Parks in her two
    letters dated August 21, 2002.  Should you have any further questions, please
    contact Helene Dreiling at my office on (202) 626-7340  Sincerely, Daniel Wilson,
    Treasurer ARCHIPAC/The American Institute of Architects Attachments"'
